import React, { Component } from 'react';

export class Registration extends Component {
    constructor(props){
        super(props);
        this.state = {
            username:"",
            password:"",
            password_confirmation:"",
            registration_errors:""
        }
    }
    handleChange(event){
        console.log("handle change",event)
    }
    handleSubmit(event){
        console.log("form submitted");
        event.preventDefault();
    }
    render() {
        return (
            <div>
                <form onSubmit = {this.handleSubmit}>
                    <input type="text" placeholder="username" value={this.state.username} onChange = {this.handleChange} required></input>
                    <input type="password" placeholder="password" value={this.state.password} onChange={this.handleChange} required></input>
                </form>
            </div>
        );
    }
}

export default Registration;
